import React, { useState }  from "react";

const Time = ()=>{
  let time = new Date().toLocaleTimeString()
  const [data , setData] = useState(time)
    return(
        <>
            <h1>{data}</h1>
            <button onClick={()=>{
                 let newdate = new Date().toLocaleTimeString()
                 setData(newdate)
            }}>Update time</button>
        </>
    )
}

export default Time;
